import './App.css';
import backgroundImage from './images/pic1.png';
import Top from './Top.jsx';

function App() {
  return (
    <div>
      <div className="h-screen overflow-hidden">
        <img src={backgroundImage} className="object-cover w-full h-full" alt="Background" />
      </div>
      <Top/>
    </div>
  );
}

export default App;
